import "./HeroImgStyles.css";
import IntroImg from "../assets/backg.jpg"
import React from 'react';

const Heroimg = () => {
  return (
    <div className="hero">
        <div className="mask">
            <img className="intro-img"
            src={IntroImg} alt="IntroImg" />
        </div>

    </div>
  )
}

export default Heroimg;
